                  statsValue: _withCtx(() => [
                    _unref(companies).get_all_company.count > 0 ? (_openBlock(), _createBlock("p", { key: 0 }, _toDisplayString(_unref(companies).get_all_company.count), 1)) : (_openBlock(), _createBlock("p", { key: 1 }, _toDisplayString("0")))
                  ]),
                  _: 1
                })
              ];
            }
          }),
          _: 1
        }, _parent));
        _push(`</div><div class="flex justify-center gap-x-4 mt-10">`);
        if (_unref(companies)?.get_all_company.count > 5) {
          _push(`<!--[-->`);
          _ssrRenderList(_unref(companies)?.get_all_company.links, (page, id) => {
            _push(`<div class="${_ssrRenderClass([{ "bg-blue-400 text-white": page.active, "bg-gray-200 text-black hover:bg-blue-400 hover:text-white transition-all": !page.active }, "px-4 py-2 rounded-full cursor-pointer"])}">${_ssrInterpolate(page.label)}</div>`);
          });
          _push(`<!--]-->`);
        } else {
          _push(`<!---->`);
        }
        _push(`</div></div>`);
      } else {
        _push(`<!---->`);
      }
      _push(`</div>`);
    };
  }
});
